import totalToRender from "./totalToRender"
import ProfileListItem from "./profileListItem"

export default function ProfileListContent({value, totalToRenderNumber, focused, setFocused}) {
  return totalToRender(value, totalToRenderNumber).map((item, i) => (
    <ProfileListItem 
      key={`ListItem${i}`} 
      data={item}
      focused={focused} 
      setFocused={setFocused}/>
  ))
}
